import React from "react";

export default function SplitGender(props) {
  function compare(a, b) {
    if (a.name < b.name) {
      return -1;
    }
    if (a.name > b.name) {
      return 1;
    }
    return 0;
  }
  return props.data.sort(compare);

  return props.data.map((baby) => baby.name).sort();
